module ndn ( clk, rst, mosi_from_mcu, miso_to_mcu, miso_from_interface, 
        mosi_to_interface, out_data, address, current_byte, write_enable, 
        read_data );
  output [7:0] out_data;
  output [9:0] address;
  output [9:0] current_byte;
  input [7:0] read_data;
  input clk, rst, mosi_from_mcu, miso_from_interface;
  output miso_to_mcu, mosi_to_interface, write_enable;
  wire   prefix_ready, out_bit, pit_in_bit, rejected, interest_packet,
         start_send_to_pit, PIT_to_SPI_bit, fib_out_bit, RX_valid, TX_valid;
  wire   [63:0] SPI_to_PIT_prefix;
  wire   [63:0] FIB_to_PIT_prefix;
  wire   [5:0] len;
  wire   [7:0] FIB_to_PIT_metadata;
  wire   [10:0] table_entry;
  wire   [7:0] metadata;
  wire   [7:0] data_fib_to_pit;
  wire   [7:0] data_spi_to_fib;
  wire   [7:0] data_fib_to_spi;

  pit_hash_table pit_hash_table_module ( .SPI_to_PIT_prefix(SPI_to_PIT_prefix), 
        .FIB_to_PIT_prefix(FIB_to_PIT_prefix), .FIB_to_PIT_metadata(
        FIB_to_PIT_metadata), .length(len), .prefix_ready(prefix_ready), 
        .out_bit(out_bit), .clk(clk), .rst(rst), .table_entry(table_entry), 
        .meta_data(metadata), .pit_in_bit(pit_in_bit), .rejected(rejected), 
        .interest_packet(interest_packet) );
  PIT pit_module ( .table_entry(table_entry), .address(address), 
        .current_byte(current_byte), .in_data(data_fib_to_pit), .read_data(
        read_data), .out_data(out_data), .write_enable(write_enable), .in_bit(
        pit_in_bit), .out_bit(out_bit), .interest_packet(interest_packet), 
        .start_bit(start_send_to_pit), .PIT_to_SPI_bit(PIT_to_SPI_bit), 
        .fib_out(fib_out_bit), .clk(clk), .reset(rst) );
  fib_table fib_module ( .pit_in_prefix(SPI_to_PIT_prefix), .pit_in_metadata(
        metadata), .rejected(rejected), .fib_out_bit(fib_out_bit), 
        .start_send_to_pit(start_send_to_pit), .data_PIT_to_FIB(out_data), 
        .RX_valid(RX_valid), .data_SPI_to_FIB(data_spi_to_fib), .clk(clk), 
        .rst(rst), .pit_out_prefix(FIB_to_PIT_prefix), .prefix_ready(
