        .data_FIB_to_PIT(data_fib_to_pit), .FIB_to_SPI_data_flag(TX_valid), 
        .data_FIB_to_SPI(data_fib_to_spi) );
  spi_mcu spi_mcu_module ( .mosi(mosi_from_mcu), .miso(miso_to_mcu), .clk(clk), 
        .rst(rst), .PIT_to_SPI_data(out_data), .PIT_to_SPI_prefix(
        FIB_to_PIT_prefix), .PIT_to_SPI_bit(PIT_to_SPI_bit), .SPI_to_PIT_bit(
        out_bit), .SPI_to_PIT_length(len), .SPI_to_PIT_prefix(
        SPI_to_PIT_prefix) );
  spi_interface spi_interface_module ( .mosi(mosi_to_interface), .miso(
        miso_from_interface), .clk(clk), .rst(rst), .RX_valid(RX_valid), 
        .output_shift_register(data_spi_to_fib), .TX_valid(TX_valid), 
        .input_shift_register(data_fib_to_spi) );
endmodule

